import React from 'react';
import {  HashRouter,Switch, Route } from 'react-router-dom';
import Home from '../pages';

import {PrivateRoute, PublicRoute} from './index';

const Routes = (props) => { 
    return (
        <HashRouter>
            <Switch>
                <Route exact path="/"  render={()=><Home />} />

            </Switch>
        </HashRouter>
    );
};
export  {Routes};
